                 1.51154440e-07 * T3 + 6.89355790e-11 * T4;
    // species 1: C2H4
    species[1] = +2.95920148e+00 - 7.57052247e-03 * T + 5.70990292e-05 * T2 -
                 6.91588753e-08 * T3 + 2.69884373e-11 * T4;
