  XW += x[14] * 1.5999000000000001e+01;    // O
  XW += x[15] * 1.7007000000000001e+01;    // OH
  XW += x[16] * 3.3006000000000000e+01;    // HO2
  XW += x[17] * 1.8015000000000001e+01;    // H2O
  XW += x[18] * 3.4014000000000003e+01;    // H2O2
  XW += x[19] * 1.0080000000000000e+00;    // H
  XW += x[20] * 3.0026000000000000e+01;    // CH2O
  XW += x[21] * 4.4009000000000000e+01;    // CO2
