  CW += c[29] * 1.0612400000000000e+02; // C6H5CHO
  CW += c[30] * 2.8013999999999999e+01; // N2
  // Now compute conversion
  amrex::Real CWinv = 1.0 / CW;
  y[0] = c[0] * 1.5429699999999997e+02 * CWinv;
  y[1] = c[1] * 2.8053999999999998e+01 * CWinv;
  y[2] = c[2] * 1.6042999999999999e+01 * CWinv;
