                          qr_co[24] - qr_co[30] - qr_co[31] - qr_co[32] -
                          qr_co[39] - qf_co[45] - qf_co[53] - qr_co[58] -
                          qf_co[61] - qr_co[65] - qr_co[84] - qf_co[87];
