  sc_qss[5] = C2H5_rhs - (+C2H5_HCO * sc_qss[2]);

  sc_qss[7] = CH2CHO_rhs - (+CH2CHO_C2H3 * sc_qss[4] + CH2CHO_HCO * sc_qss[2]);

